static int casadi_f11(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s134;
  p.sp_h = casadi_s145;
  p.sp_at = casadi_s135;
  p.sp_kkt = casadi_s151;
  p.sp_v = casadi_s152;
  p.sp_r = casadi_s153;
  p.prinv = casadi_s154;
  p.pc =  casadi_s155;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 414, d.lbz);
  } else {
    casadi_fill(d.lbz, 414, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 729, d.lbz+414);
  } else {
    casadi_fill(d.lbz+414, 729, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 414, d.ubz);
  } else {
    casadi_fill(d.ubz, 414, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 729, d.ubz+414);
  } else {
    casadi_fill(d.ubz+414, 729, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 414, d.z);
  } else {
    casadi_clear(d.z, 414);
  }
  casadi_fill(d.z+414, 729, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 414, d.lam);
  } else {
    casadi_clear(d.lam, 414);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 729, d.lam+414);
  } else {
    casadi_clear(d.lam+414, 729);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 414, res[0]);
  if (res[3]) casadi_copy(d.lam, 414, res[3]);
  if (res[2]) casadi_copy(d.lam+414, 729, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

